syntax = "proto3";
import "CommEnterDungeonRequest.proto";
import "PlayerItem.proto";
import "PlayerItem.proto";
//生成文件所在包名
option java_package = "com.gejian.pixel.proto";
//生成的java文件名
option java_outer_classname = "CommEnterDungeonResponseProtobuf";

message	CommEnterDungeonResponse  {
		uint32	result = 10;
		CommEnterDungeonRequest	request = 11;
	repeated	PlayerItem	items = 12;
	repeated	PlayerItem	archives = 13;
}